CREATE TABLE IF NOT EXISTS `companies` (
	`symbol`	VARCHAR(10),
	`name`	TEXT NOT NULL,
	`sector`	TEXT NOT NULL,
	`subindustry`	TEXT,
	`address`	TEXT,
	`exchange`	TEXT,
	`website`	TEXT,
	`description`	TEXT,
	`latitude`	REAL,
	`longitude`	REAL,
	`financials`	TEXT,
	PRIMARY KEY(`symbol`)
);
CREATE TABLE IF NOT EXISTS `history` (
	`id`	INTEGER,
	`symbol`	TEXT NOT NULL,
	`date`	TEXT,
	`volume`	INTEGER,
	`open`	REAL,
	`close`	REAL,
	`high`	REAL,
	`low`	REAL,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `portfolio` (
	`id`	INTEGER,
	`userId`	INTEGER NOT NULL,
	`guid`	TEXT,
	`symbol`	TEXT NOT NULL,
	`amount`	INTEGER,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `users` (
	`id`	INTEGER,
	`firstname`	TEXT NOT NULL,
	`lastname`	TEXT NOT NULL,
	`city`	TEXT,
	`country`	TEXT,
	`email`	TEXT,
	`password`	TEXT,
	`salt`	TEXT,
	`password_sha256`	TEXT,
	PRIMARY KEY(`id`)
);

